const userNames = ['Colby', 'Joseph', 'Barton', 'marc', 'kristi']


const getRandomUser = function getRandomInt() {
  let min = 0;
  let max = userNames.length;
  let index = Math.floor(Math.random() * (max - min)) + min; //The maximum is exclusive and the minimum is inclusive
  return userNames[index];
}

const commentsWithNewUserNames = mockComments.map(comment => {
  let randomUser = getRandomUser()
  comment.user_name = randomUser;
  return comment;
});


commentsWithNewUserNames.forEach( c => {
  let commentCopy = Object.assign({}, c)
  delete commentCopy.user_name
  
  db('users').select('user_id')
    .where( { user_name : c.user_name })
    .then( data => {
      if (!data.length) {
        console.log('User not found!')
        return;
      }
      commentCopy.user_id = data[0].user_id
      
      db('comments')
        .returning([ 'comment_id','user_id', 'video_id', 'message', 'comment_timestamp'])
        .insert(commentCopy)
        .then( results => 
          console.log(results)
        )
        .catch( err => {
          console.error(err);
        })
    })
})

